import java.text.SimpleDateFormat;
import java.time.Period;
import java.time.LocalDate;

long DAY_IN_MS = 1000 * 60 * 60 * 24;
long SUB_DAYS_IN_MS=DAY_IN_MS*((int) (Math.random() * 20000)+9000);
String dob= new SimpleDateFormat("dd/MM/yyyy").format(new Date(System.currentTimeMillis() - (SUB_DAYS_IN_MS)));
String dob_travel= new SimpleDateFormat("yyyy-MM-dd").format(new Date(System.currentTimeMillis() - (SUB_DAYS_IN_MS)));
testRunner.testCase.getTestStepByName('Properties').setPropertyValue('dob_travel',dob_travel);

testRunner.testCase.getTestStepByName('Properties').setPropertyValue('day',dob.substring(0,2));
testRunner.testCase.getTestStepByName('Properties').setPropertyValue('month',dob.substring(3,5));
testRunner.testCase.getTestStepByName('Properties').setPropertyValue('year',dob.substring(6));
testRunner.testCase.getTestStepByName('Properties').setPropertyValue('dob',dob);

LocalDate today = LocalDate.now();
log.info(today);                              
LocalDate birthday = LocalDate.parse(dob_travel); 
log.info(birthday);                            
Period age = Period.between(birthday, today);
log.info(age.getYears());
testRunner.testCase.getTestStepByName('Properties').setPropertyValue('age',age.getYears().toString());

return dob;

